import React, { useState } from 'react';

const DraftedForm = ({ saveDrafted }) => {
  const [drafted, setDrafted] = useState('');

  return (
    <form
      onSubmit={(event) => {
        event.preventDefault();

        saveDrafted(drafted);

        setValue('');
      }}
    >
      <textarea
        variant="outlined"
        placeholder="Add drafted"
        margin="normal"
        onChange={(event) => {
          setDrafted(event.target.value);
        }}
        value={drafted}
      />
    </form>
  );
};

export default DraftedForm;
